import React from 'react';

export default function TicketConfirmation(props) {

    const handleConfirm = () => {
        console.log("confirm the ticket")
        props.clearTicket()
    }

    return (
        <>
            <div className="Ticket-info">
                <h1>{props.name}</h1>
                <h1>{props.email}</h1>
                <h1>{props.code}</h1>
            </div>
            <div>
                <button onClick={handleConfirm}>Confirm</button>
                <button onClick={props.clearTicket}>Discard</button>
            </div>
        </>
    );
}
